inline void srand(int seed)
{
  g_seed = seed;
}

// Compute a pseudorandom integer.
// Output value in range [0, 32767]
inline int rand(void)
{
  g_seed = (214013 * g_seed + 2531011);
  return (g_seed >> 16) & 0x7FFF;
}

double fabs(double x)
{
  if (x < 0)
  {
    return -x;
  }
  return x;
}

double exp(double x)
{
  const double epsilon = 1e-7;
  double sum = 0.0;
  int n = 0;
  double factorial = 1;
  double power = 1.0;
  double term;
  do
  {
    term = power / factorial;
    sum += term;
    n += 1;
    power *= x;
    factorial *= n;
  } while (fabs(term) >= epsilon);
  return sum;
}

float atof(const char *s)
{
  float rez = 0, fact = 1;
  if (*s == '-')
  {
    s++;
    fact = -1;
  };
  for (int point_seen = 0; *s; s++)
  {
    if (*s == '.')
    {
      point_seen = 1;
      continue;
    };
    int d = *s - '0';
    if (d >= 0 && d <= 9)
    {
      if (point_seen)
        fact /= 10.0f;
      rez = rez * 10.0f + (float)d;
    };
  };
  return rez * fact;
}

void toTerminal()
{

  for (p = 0; p < PatternCount; p++)
  {
    printf("\n");
    printf("\n  Training Pattern: %d", p);
    printf("\n Input \n");
    for (i = 0; i <= InputNodes; i++)
    {
      printf("%.0f ", Input[p][i]);
      if (i % 40 == 39)
        printf("\n");
    }
    printf("  Target ");
    for (i = 0; i < OutputNodes; i++)
    {
      printf("%.1f ", Target[p][i]);
    }
    //Compute hidden layer activations
    for (i = 0; i < HiddenNodes; i++)
    {
      Accum = 0.0; //HiddenWeights[InputNodes][i] ;
      for (j = 0; j <= InputNodes; j++)
      { // bias included
        Accum += Input[p][j] * HiddenWeights[j][i];
      }
      Hidden[i] = 1.0 / (1.0 + exp(-Accum));
    }

    //Compute output layer activations and calculate errors
    for (i = 0; i < OutputNodes; i++)
    {
      Accum = 0.0; //OutputWeights[HiddenNodes][i] ;
      for (j = 0; j <= HiddenNodes; j++)
      { // bias included
        Accum += Hidden[j] * OutputWeights[j][i];
      }
      Output[i] = 1.0 / (1.0 + exp(-Accum));
    }
    printf("  Output ");
    for (i = 0; i < OutputNodes; i++)
    {
      printf("%.5f ", Output[i]);
    }
  }
}

void weight_save()
{
  FILE *fp;
  fp = fopen("weight_data.txt", "w");
  for (int j = 0; j <= InputNodes; j++)
  {
    for (int i = 0; i < HiddenNodes; i++)
    {
      fprintf(fp, "%f, ", HiddenWeights[j][i]);
      printf("%f, ", HiddenWeights[j][i]);
    }
    fprintf(fp, "\n");
    printf("<=== %d \n", j);
  }

  for (int j = 0; j <= HiddenNodes; j++)
  {
    for (int i = 0; i < OutputNodes; i++)
    {
      fprintf(fp, "%f, ", OutputWeights[j][i]);
      printf("%f, ", OutputWeights[j][i]);
    }
    fprintf(fp, "\n");
    printf("<=== %d \n", j);
  }
  fclose(fp);
  printf("weights saved ! \n");
}

