void prediction()
{

  for (p = 0; p < test_PatternCount; p++)
  {
    printf("\n");
    printf("\n  Testing Pattern: %d", p);
    printf("\n Input \n");
    for (i = 0; i <= InputNodes; i++)
    {
      printf("%.0f ", test_Input[p][i]);
      if (i % 40 == 39)
        printf("\n");
    }

    //Compute hidden layer activations
    for (i = 0; i < HiddenNodes; i++)
    {
      Accum = 0.0; //HiddenWeights[InputNodes][i] ;
      for (j = 0; j <= InputNodes; j++)
      {
        Accum += test_Input[p][j] * HiddenWeights[j][i];
      }
      Hidden[i] = 1.0 / (1.0 + exp(-Accum));
    }

    //Compute output layer activations and calculate errors
    for (i = 0; i < OutputNodes; i++)
    {
      Accum = 0.0; //OutputWeights[HiddenNodes][i] ;
      for (j = 0; j <= HiddenNodes; j++)
      {
        Accum += Hidden[j] * OutputWeights[j][i];
      }
      Output[i] = 1.0 / (1.0 + exp(-Accum));
    }
    printf("\n  Testing Output ");
    for (i = 0; i < OutputNodes; i++)
    {
      printf("%.5f ", Output[i]);
    }
  }
  printf("\nPrediction Done ! \n\n");
}

void setup()
{
  Hidden[HiddenNodes] = 1; // hidden bias node
  srand(100);
  ReportEvery1000 = 1;
  for (p = 0; p < PatternCount; p++)
  {
    RandomizedIndex[p] = p;
  }
}

void loop()
{

  //Initialize HiddenWeights and ChangeHiddenWeights
  for (i = 0; i < HiddenNodes; i++)
  {
    for (j = 0; j <= InputNodes; j++)
    {
      ChangeHiddenWeights[j][i] = 0.0;
      Rando = rand() % 100 / 100.;
      HiddenWeights[j][i] = 2.0 * (Rando - 0.5) * InitialWeightMax;
    }
  }
  //Initialize OutputWeights and ChangeOutputWeights
  for (i = 0; i < OutputNodes; i++)
  {
    for (j = 0; j <= HiddenNodes; j++)
    {
      ChangeOutputWeights[j][i] = 0.0;
      Rando = rand() % 100 / 100.;
      OutputWeights[j][i] = 2.0 * (Rando - 0.5) * InitialWeightMax;
    }
  }
  printf("Initial/Untrained Outputs: ");
  toTerminal();
  //Begin training
  for (TrainingCycle = 1; TrainingCycle < 2147483647; TrainingCycle++)
  {

    //Randomize order of training patterns
    for (p = 0; p < PatternCount; p++)
    {
      //q = random(PatternCount);
      //r = RandomizedIndex[p] ;
      q = rand() % PatternCount;
      r = RandomizedIndex[p];
      RandomizedIndex[p] = RandomizedIndex[q];
      RandomizedIndex[q] = r;
    }
    Error = 0.0;
    //Cycle through each training pattern in the randomized order
    for (q = 0; q < PatternCount; q++)
    {
      p = RandomizedIndex[q];

      //Compute hidden layer activations
      for (i = 0; i < HiddenNodes; i++)
      {
        Accum = 0; //HiddenWeights[InputNodes][i] ;
        for (j = 0; j <= InputNodes; j++)
        {
          Accum += Input[p][j] * HiddenWeights[j][i];
        }
        Hidden[i] = 1.0 / (1.0 + exp(-Accum));
      }

      //Compute output layer activations and calculate errors
      for (i = 0; i < OutputNodes; i++)
      {
        Accum = 0; //OutputWeights[HiddenNodes][i] ;
        for (j = 0; j <= HiddenNodes; j++)
        {
          Accum += Hidden[j] * OutputWeights[j][i];
        }
        Output[i] = 1.0 / (1.0 + exp(-Accum));
        OutputDelta[i] = (Target[p][i] - Output[i]) * Output[i] * (1.0 - Output[i]);
        Error += 0.5 * (Target[p][i] - Output[i]) * (Target[p][i] - Output[i]);
      }

      //Backpropagate errors to hidden layer
      for (i = 0; i <= HiddenNodes; i++)
      {
        Accum = 0.0;
        for (j = 0; j < OutputNodes; j++)
        {
          Accum += OutputWeights[i][j] * OutputDelta[j];
        }
        HiddenDelta[i] = Accum * Hidden[i] * (1.0 - Hidden[i]);
      }

      //Update Inner-->Hidden Weights
      for (i = 0; i < HiddenNodes; i++)
      {
        ChangeHiddenWeights[InputNodes][i] = LearningRate * HiddenDelta[i] + Momentum * ChangeHiddenWeights[InputNodes][i];
        HiddenWeights[InputNodes][i] += ChangeHiddenWeights[InputNodes][i];
        for (j = 0; j <= InputNodes; j++)
        {
          ChangeHiddenWeights[j][i] = LearningRate * Input[p][j] * HiddenDelta[i] + Momentum * ChangeHiddenWeights[j][i];
          HiddenWeights[j][i] += ChangeHiddenWeights[j][i];
        }
      }

      //Update Hidden-->Output Weights
      for (i = 0; i < OutputNodes; i++)
      {
        ChangeOutputWeights[HiddenNodes][i] = LearningRate * OutputDelta[i] + Momentum * ChangeOutputWeights[HiddenNodes][i];
        OutputWeights[HiddenNodes][i] += ChangeOutputWeights[HiddenNodes][i];
        for (j = 0; j <= HiddenNodes; j++)
        {
          ChangeOutputWeights[j][i] = LearningRate * Hidden[j] * OutputDelta[i] + Momentum * ChangeOutputWeights[j][i];
          OutputWeights[j][i] += ChangeOutputWeights[j][i];
        }
      }
    }

    //Every 1000 cycles send data to terminal for display
    ReportEvery1000 = ReportEvery1000 - 1;
    if (ReportEvery1000 == 0)
    {
      printf("\n");
      printf("\n");
      printf("TrainingCycle: %ld  Error = %.5f \n", TrainingCycle, Error);

      toTerminal();

      if (TrainingCycle == 1)
      {
        ReportEvery1000 = 999;
      }
      else
      {
        ReportEvery1000 = 1000;
      }
    }

    //If error rate is less than pre-determined threshold then end
    if (Error < Success)
      break;
  }
  printf("\n");
  printf("\n");
  printf("TrainingCycle: %ld  Error = %.5f \n", TrainingCycle, Error);

  toTerminal();

  printf("\n\nTraining Set Solved!\n--------\n\n");
  ReportEvery1000 = 1;
}

int main()
{
  setup();
  loop();
  prediction();
  weight_save();
  weight_load();
  prediction();
  return 0;
}
